export const examples = [
    {
        name: "water",
        blueprint_uuid: "f806f2e6-22ce-430c-b352-12c5d8286019",
        comment: "",
        commands: {},
        sensors: [
            {
                name: "biological",
                value: "biological",
                data_type: "double"
            },
            {
                name: "physical",
                sensor_id: "physical",
                data_type: "integer"
            }
        ],
        attributes: {
            location: "details about location",
            path: "Path to device"
        }
    },
    {
        name: "auto",
        blueprint_uuid: "k806f2e6-22ce-430c-b352-12c5d8287052",
        comment: "",
        commands: { Beep: "Does sound" },
        sensors: [{ name: gas, value: "value", data_type: "integer" }],
        attributes: {
            protocol: "bus protocol",
            path: "Path to device"
        }
    }
];
